<script setup>
    import { serverURL, URL, token } from "@/helpers/token"
    import axios from "@axios"

    const heartbeat = ref([])

	const fetchHeartbeat = () => {
        axios
            .post(
                URL() + `/heart_beat`,
                {
                    requestType: "view",
                    module: "RFID_PEOPLE",
                },
                { headers: { Authorization: token() } }
            )
            .then((response) => {
                //   this.listings = response.data;
                console.log("heartbeat axios");
                console.log(response.data.data);
                heartbeat.value = response.data.data;

                let filteredData = heartbeat.value.filter((layer) => layer.ping_status === false);
                console.log("heartbeat axios filter");
                console.log(filteredData);

                filteredData.forEach((obj) => {
                    document.getElementById(obj.host_name).classList.remove("circle");
                    document.getElementById(obj.host_name).classList.add("circle-red");
                });
            })
            .catch((error) => {
                //   isErrorAlertVisible.value=true
                //   isAlertVisible.value=false
                //   err.value=error
                console.error(error);
				if(error.response.status <= 400){
					window.location = serverURL() + "/error/access-denied"
				}
            });
    }

    watchEffect(fetchHeartbeat());
    console.log("view heart beat");
    console.log(heartbeat);

    const isSnackbarVisible = ref(false);

    const location = ref("");
    const ip_address = ref("");
    const status = ref("");
    const last_update = ref("");

    const mouseover = (id) => {
        isSnackbarVisible.value = true;
        console.log("mouseover heartbeat");
        let filteredData = heartbeat.value.filter((layer) => layer.host_name.includes(id)).reverse();

        console.log(filteredData);
        location.value = id;
        if (filteredData) {
            filteredData.forEach((obj) => {
                ip_address.value = obj.ip_address;
                status.value = obj.ping_status ? 'Active':'Inactive'
                last_update.value = obj.timestamp; // Assigning a new property with an updated value

                if (obj.ping_status) {
                    document.getElementById(id).classList.remove("circle");
                    document.getElementById(id).classList.add("circle-hover");
                }

                if (!obj.ping_status) {
                    document.getElementById(id).classList.remove("circle");
                    document.getElementById(id).classList.remove("circle-red");
                    document.getElementById(id).classList.add("circle-hover");
                }
            });
        }
    };

    const mouseleave = (id) => {
        isSnackbarVisible.value = false;
        location.value = "";
        ip_address.value = "";
        status.value = "";
        last_update.value = "";

        let filteredData = heartbeat.value.filter((layer) => layer.host_name.includes(id)).reverse();

        console.log(filteredData);
        location.value = id;
        if (filteredData) {
            filteredData.forEach((obj) => {
				// Assigning a new property with an updated value
                ip_address.value = obj.ip_address;
                status.value = obj.ping_status;
                last_update.value = obj.timestamp; 
				document.getElementById(id).classList.remove("circle-hover");
                if (obj.ping_status) {
                    document.getElementById(id).classList.add("circle");
                }

                if (!obj.ping_status) {
                    document.getElementById(id).classList.add("circle-red");
                }
            });
        
        }
    };
</script>

