<script>
    import panzoom from "panzoom";

    export default {
        //props: ['heartbeatData'],
        mounted() {
            const container = this.$refs.container;
            const svgElement = this.$refs.svgElement;

            const panZoomInstance = panzoom(svgElement, {
                // Configure PanZoom options here if needed

                // Configure PanZoom options here
                minZoom: 1.5,
                maxZoom: 7,
                initialX: 350,
                initialY: 400,
                initialZoom: 2.5,
