            this.isDragging = false;
            this.startX = 0;
            this.startY = 0;
            this.offsetX = 0;
            this.offsetY = 0;

            container.addEventListener("wheel", panZoomInstance.zoomWithWheel);
            container.addEventListener("mousedown", panZoomInstance.panstart);
            container.addEventListener("mousemove", panZoomInstance.panmove);
            container.addEventListener("mouseup", panZoomInstance.panend);
            container.addEventListener("mouseleave", panZoomInstance.panend);
            container.addEventListener("dblclick", panZoomInstance.zoomToPoint);

            container.addEventListener("touchstart", panZoomInstance.touchstart);
            container.addEventListener("touchmove", panZoomInstance.touchmove);
            container.addEventListener("touchend", panZoomInstance.touchend);

            this.panZoomInstance = panZoomInstance;
        },
        methods: {
            zoomIn() {
                const { x, y, scale } = this.panZoomInstance.getTransform();
                this.panZoomInstance.zoomAbs(-129 - x, -276 - y, scale + 1.2); // Adjust the zoom increment as needed
            },
            zoomOut() {
                const { x, y, scale } = this.panZoomInstance.getTransform();
                this.panZoomInstance.zoomAbs(-129 - x, -276 - y, scale - 0.8); // Adjust the zoom increment as needed
            },
            refresh() {
                // 	this.panZoomInstance.moveTo(-129,-276);
                //   this.panZoomInstance.zoomAbs(100, 200, 1.5);
                const svgElement = this.$refs.svgElement;
                const newX = -525; // Set the desired X coordinate
                const newY = -600; // Set the desired Y coordinate
                const newScale = 2.5; // Set the desired scale

                svgElement.style.transformOrigin = "0 0";
                svgElement.style.transform = `translate(${newX}px, ${newY}px) scale(${newScale})`;
            },
        },
    };
</script>

